import React from 'react';

function List(props) {

    const list = [
        {
            content: "学习react",
            status: false,
        },
        {
            content: "扫地",
            status: false,
        },
        {
            content: "投简历",
            status: false,
        },
        {
            content: "背面试题",
            status: false,
        },
    ];

        
        const lis = list.map((item, index) => {
            return (
                <li key={index} className='text-primary'>
                    <span>{item.content}</span>
                    <button type='button' className='close'>&times;</button>
                </li>
            )
        })
    
    return (
        <div>
           {lis}
        </div>
    );
}

export default List;
